function _KO_SPF_mileage()
	ai = getAlignmentInfo() -- 'Pos' is ,ed as 'RelativePosition'
	if RC__isNan(ai.RelativePosition) then return nil,_info("Relative position not found.") end
	return ai.RelativePosition < (Alignment.RcAlignment.HorizontalProfile.Length - ai.RelativePosition)
			and Alignment.RcAlignment.StartMileage or Alignment.RcAlignment.EndMileage
end

